import axios from 'axios';

const getMatches = (callback, query) => {
    axios.defaults.headers = {
        'Cache-Control': 'no-cache',
        'Pragma': 'no-cache',
        'Expires': '0',
    };
    axios.get('https://wl39.host.cs.st-andrews.ac.uk/api/match/search' + query,
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}


